import React from 'react'

function Ingredient({ingredient}) {

  return (
    <div>
        <img src={ingredient.image} />
        <span>{ingredient.price}<CurrencyIcon type="primary" /></span>
        <p>{ingredient.name}</p>
    </div>
  )
}

export default Ingredient
